import React from 'react';
import Main from './pages/main'; 

import {
    BrowserRouter as Router,
    Route,
    Switch,
    Lin,
    Redirect
}   from 'react-router-dom';

export default function App (){
    return(
        <Router>
            <Route path='/main' component={Main} />
        </Router>
    )
}
